import React, { useState } from 'react';
import {
  ThemeProvider,
  createTheme,
  CssBaseline,
  Container,
  Box,
  Typography,
  Tabs,
  Tab,
  Paper,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Chip,
  useMediaQuery,
} from '@mui/material';
import { motion, AnimatePresence } from 'framer-motion';
import { players } from './data/players';
import { Player, PlayerCategory, PlayerSubCategory } from './types';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#00ff9f',
    },
    secondary: {
      main: '#ff00ff',
    },
    background: {
      default: '#0a1929',
      paper: '#132f4c',
    },
  },
  typography: {
    fontFamily: '"Poppins", "Roboto", "Helvetica", "Arial", sans-serif',
  },
  components: {
    MuiCard: {
      styleOverrides: {
        root: {
          background: 'rgba(19, 47, 76, 0.8)',
          backdropFilter: 'blur(10px)',
          border: '1px solid rgba(255, 255, 255, 0.1)',
          borderRadius: '16px',
          transition: 'transform 0.2s ease-in-out',
          '&:hover': {
            transform: 'translateY(-5px)',
          },
        },
      },
    },
  },
});

const MotionCard = motion(Card);

const PlayerCard: React.FC<{ player: Player }> = ({ player }) => {
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <MotionCard
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      exit={{ opacity: 0, y: -20 }}
    >
      <CardContent>
        <Typography variant="h6" gutterBottom>
          {player.name}
        </Typography>
        <Typography color="textSecondary" gutterBottom>
          {player.team}
        </Typography>
        <Box sx={{ mt: 2 }}>
          <Grid container spacing={1}>
            <Grid item xs={6}>
              <Typography variant="body2">
                Matches: {player.performance.matches}
              </Typography>
            </Grid>
            {player.performance.runs && (
              <Grid item xs={6}>
                <Typography variant="body2">
                  Runs: {player.performance.runs}
                </Typography>
              </Grid>
            )}
            {player.performance.wickets && (
              <Grid item xs={6}>
                <Typography variant="body2">
                  Wickets: {player.performance.wickets}
                </Typography>
              </Grid>
            )}
            {player.performance.battingAverage && (
              <Grid item xs={6}>
                <Typography variant="body2">
                  Avg: {player.performance.battingAverage}
                </Typography>
              </Grid>
            )}
            {player.performance.bowlingAverage && (
              <Grid item xs={6}>
                <Typography variant="body2">
                  Bowl Avg: {player.performance.bowlingAverage}
                </Typography>
              </Grid>
            )}
          </Grid>
        </Box>
      </CardContent>
    </MotionCard>
  );
};

const App: React.FC = () => {
  const [selectedCategory, setSelectedCategory] = useState<PlayerCategory>(
    PlayerCategory.KEEPER
  );
  const [selectedSubCategory, setSelectedSubCategory] = useState<
    PlayerSubCategory | undefined
  >(undefined);

  const filteredPlayers = players.filter(
    (player) => player.category === selectedCategory
  );

  const subCategories = {
    [PlayerCategory.ALLROUNDER]: [
      PlayerSubCategory.SPINNER_ALLROUNDER,
      PlayerSubCategory.FAST_BOWLING_ALLROUNDER,
    ],
    [PlayerCategory.BOWLER]: [
      PlayerSubCategory.SPINNER,
      PlayerSubCategory.FAST_BOWLER,
    ],
  };

  const handleCategoryChange = (event: React.SyntheticEvent, newValue: PlayerCategory) => {
    setSelectedCategory(newValue);
    setSelectedSubCategory(undefined);
  };

  const handleSubCategoryChange = (subCategory: PlayerSubCategory) => {
    setSelectedSubCategory(subCategory);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="lg">
        <Box sx={{ py: 4 }}>
          <Typography
            variant="h3"
            component="h1"
            gutterBottom
            sx={{
              textAlign: 'center',
              mb: 4,
              background: 'linear-gradient(45deg, #00ff9f 30%, #ff00ff 90%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
          >
            Domestic Dream11
          </Typography>

          <Paper
            sx={{
              p: 2,
              mb: 4,
              background: 'rgba(19, 47, 76, 0.8)',
              backdropFilter: 'blur(10px)',
            }}
          >
            <Tabs
              value={selectedCategory}
              onChange={handleCategoryChange}
              variant="scrollable"
              scrollButtons="auto"
              sx={{
                '& .MuiTab-root': {
                  color: 'rgba(255, 255, 255, 0.7)',
                  '&.Mui-selected': {
                    color: '#00ff9f',
                  },
                },
              }}
            >
              <Tab label="Keepers" value={PlayerCategory.KEEPER} />
              <Tab label="Opening Batters" value={PlayerCategory.OPENING_BATTER} />
              <Tab label="Allrounders" value={PlayerCategory.ALLROUNDER} />
              <Tab label="Bowlers" value={PlayerCategory.BOWLER} />
            </Tabs>

            {subCategories[selectedCategory] && (
              <Box sx={{ mt: 2, display: 'flex', gap: 1, flexWrap: 'wrap' }}>
                {subCategories[selectedCategory].map((subCategory) => (
                  <Chip
                    key={subCategory}
                    label={subCategory.replace(/_/g, ' ')}
                    onClick={() => handleSubCategoryChange(subCategory)}
                    color={selectedSubCategory === subCategory ? 'primary' : 'default'}
                    sx={{ m: 0.5 }}
                  />
                ))}
              </Box>
            )}
          </Paper>

          <Grid container spacing={3}>
            <AnimatePresence>
              {filteredPlayers
                .filter(
                  (player) =>
                    !selectedSubCategory || player.subCategory === selectedSubCategory
                )
                .map((player) => (
                  <Grid item xs={12} sm={6} md={4} key={player.id}>
                    <PlayerCard player={player} />
                  </Grid>
                ))}
            </AnimatePresence>
          </Grid>
        </Box>
      </Container>
    </ThemeProvider>
  );
};

export default App;
